import React from 'react';

const ComponentToRender = ({ renderComponent }) => {
    return (
        <div className='rendered-component' style={{display: 'flex', justifyContent: 'center'}}>
            {renderComponent()}
        </div>
    )
}

export default ComponentToRender;
